'''Black trimmed armour''' is a possible reward from [[Clue scroll (easy)|easy]] [[Treasure Trails]]. The set has identical stats to [[Black armour]]. The armour pieces '''cannot''' be made via the [[Smithing]] skill, neither can anything made with black metal as Black bars don't exist in game.

